import React from 'react';
import { Routes, Route, useNavigate } from 'react-router-dom';
import UsersPage from './pages/UsersPage';
import '../styles/Dashboard.css';

const sidebarItems = [
  { label: 'Admin Dashboard', path: '/dashboard' },
  { label: 'Users', path: '/dashboard/users' },
  { label: 'Banks', path: '/dashboard/banks' },
  { label: 'Inward Registry' },
  { label: 'Documents' },
  { label: 'Photographs' },
  { label: 'Utilities' },
  { label: 'Invoice' },
  { label: 'Outward' },
  { label: 'Data Master' },
  { label: 'Logout', isLogout: true },
];

const Dashboard = () => {
  const navigate = useNavigate();

  return (
    <div style={{ display: 'flex', minHeight: '100vh', background: '#f4f6fa', position: 'relative' }}>
      {/* Sidebar */}
      <aside style={{
        width: 230,
        background: '#009688',
        color: '#fff',
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        position: 'fixed',
        left: 0,
        top: 0,
        bottom: 0,
        zIndex: 101
      }}>
        <div style={{
          fontWeight: 'bold',
          fontSize: 18,
          marginBottom: 24,
          textAlign: 'center',
          padding: '24px 0 0 0',
          borderBottom: '1px solid #00796b'
        }}>
          <img src="https://i.imgur.com/2yaf2wb.png" alt="Logo" style={{ height: 40, marginBottom: 10 }} />
          <div>Welcome <span style={{ textDecoration: 'underline', fontWeight: 600 }}>test</span></div>
        </div>
        <nav style={{ flex: 1 }}>
          <ul className="sidebar-list" style={{ listStyle: 'none', padding: 0, margin: 0 }}>
            {sidebarItems.map(item => (
              <li
                key={item.label}
                className={`sidebar-item${item.isLogout ? ' logout' : ''}`}
                onClick={() => {
                  if (item.isLogout) {
                    // handle logout here
                  } else if (item.path) {
                    navigate(item.path);
                  }
                }}
                style={{
                  padding: '14px 28px',
                  cursor: 'pointer',
                  background: item.isLogout ? '#00897b' : 'transparent',
                  color: '#fff',
                  fontWeight: item.isLogout ? 'bold' : 500,
                }}
              >
                {item.label}
              </li>
            ))}
          </ul>
        </nav>
      </aside>

      {/* Main Content */}
      <main style={{ flex: 1, padding: 32, marginLeft: 230, paddingBottom: 70 }}>
        <Routes>
          <Route path="/" element={<div>Dashboard Home</div>} />
          <Route path="users" element={<UsersPage />} />
          {/* ...other routes... */}
        </Routes>
      </main>

      {/* Fixed Footer */}
      <footer style={{
        position: 'fixed',
        left: 230,
        right: 0,
        bottom: 0,
        background: '#009688',
        color: '#fff',
        borderRadius: 0,
        textAlign: 'center',
        padding: '10px 0',
        fontSize: 15,
        fontWeight: 500,
        zIndex: 100
      }}>
        Powered by KM Valuers<br />
        Developed and Maintained By: Valuer Wallet, Contact: 9989803310 © 2025
      </footer>
    </div>
  );
};

export default Dashboard;
